import React, { useState, useEffect } from "react";
import MenuRestaurant from "../../components/RestMenu";
import HeaArrow from "../../components/HeaArr";

import axios from "axios";

const CreateMenu = () => {
  // const handleSubmit = (data) => {
  //   createDishes(data);
  // };

  const [getDishes, setGetDishes] = useState([]);
  useEffect(async () => {
    const response = await axios(
      "http://ec2-18-216-57-107.us-east-2.compute.amazonaws.com/api/plate/"
    );
    setGetDishes(response.data);
  }, []);

  return (
    <div>
      <HeaArrow />
      <h3
        style={{
          fontFamily: "GothamBold",
          display: "flex",
          justifyContent: "center",
        }}
      >
        Creación de menú
      </h3>
      {getDishes.map((dishes) => (
        <MenuRestaurant name={dishes.name} type={dishes.type} />
      ))}
    </div>
  );
};

export default CreateMenu;
